import { Typography } from '@mui/material';
import { styled } from '@mui/system';
import { Box,Container } from '@mui/system';
import React from 'react';

import fbIcon from "../assets/facebook.png";
import twitterIcon from "../assets/twitter.png";
import linkedinIcon from "../assets/instagram.png";

const Footer=() => {
    const CustomContainer =styled(Container)(({theme}) =>({
        display: "flex",
        justifyContent: "space-around",
        gap: theme.spacing(5),
        [theme.breakpoints.down("sm")]:{
            flexDirection: "column",
            textAlign: "center",
        },
    }));

    const IconBox = styled(Box)(({ theme })=> ({
        display:"flex",
        alignItems:"center",
        gap:"1rem",
        [theme.breakpoints.down("sm")]:{
            justifyContent: "center",
        },
      }));


    const FooterLink = styled("span")(({ theme }) =>({
        fontSize: "16px",
        color: "#000066",
        fontWeight: "300",
        cursor: "pointer",
        "&:hover": {
            color: "#66B2FF",
        },
    }));

  return (
    <Box sx={{ py:10, backgroundColor: "#FFF6B2"}}>
     <CustomContainer>
       <Box>
        <Typography
            sx={{
                fontSize: "20px",
                color: "#1C1C1D",
                fontWeight:"700",
                mb:2,
            }}
            >
             Featured
        </Typography>
        <FooterLink>Guides</FooterLink>
        
        <br/>
        <FooterLink>Services</FooterLink>
        <br/>
        <FooterLink>Contact Us</FooterLink>
       </Box>

       <Box>
         <Typography
            sx={{
                fontSize: "20px",
                color: "#1C1C1D",
                fontWeight:"700",
                mb:2,
            }}
            >
             Overview
        </Typography>
        <FooterLink>Location</FooterLink>
        
        <br/>

        <FooterLink>Partnerships</FooterLink>

        <br/>

        <FooterLink>Terms of use & privacy policies</FooterLink>
       </Box>

       <Box>
       <Typography
            sx={{
                fontSize: "20px",
                color: "#1C1C1D",
                fontWeight:"700",
                mb:2,
            }}
            >
             Get in touch
        </Typography>

        <Typography
            sx={{
                fontSize: "16px",
                color: "#7A7A7E",
                fontWeight:"500",
                mb:2,
            }}
            >
             Keep in touch with our social media pages.
        </Typography>

        <IconBox>
            <img
            src={fbIcon}
            alt="fbIcon"
            style={{ cursor: "pointer"}}
            />
             <img
            src={twitterIcon}
            alt="twitterIcon"
            style={{ cursor: "pointer"}}
            />
             <img
            src={linkedinIcon}
            alt="linkedinIcon"
            style={{ cursor: "pointer"}}
            />
        </IconBox>
       </Box>

     </CustomContainer>
    </Box>
  );
};

export default Footer;
